                  "attributedDescriptionBodyText": {
                    "content": "Official Music Video for Gimme! Gimme! Gimme! (A Man After Midnight) performed by ABBA.\nListen to the new album: https://abba.lnk.to/VoyageAlbum\nListen to more music by ABBA: https://abba.lnk.to/musicID\n \nFollow ABBA:\nFacebook: /abba\nInstagram: /abba\nTwitter: /abba\nTikTok: /abba \nRead More About ABBA: http://www.abbasite.com\n\nVideo produced by: Lasse Hallstrm\n\nLyrics:\n\nHalf past twelve \nand Im watchin the late show \nin my flat all alone \nhow I hate to spend \nthe evening on my own \nautumn winds \nblowin outside the window \nas I look around the room \nand it makes me so \ndepressed to see the gloom \ntheres not a soul out there \nno one to hear my prayer \n\nGimme! Gimme! Gimme! \nA man after midnight \nwont somebody help me \nchase the shadows away \nGimme! Gimme! Gimme! \nA man after midnight \ntake me through the darkness \nto the break of the day \n\nMovie stars \nfind the end of the rainbow \nwith a fortune to win \nits so different from \nthe world Im living in \ntired of TV \nI open the window \nand I gaze into the night \nbut theres nothing there to see \nno one in sight \ntheres not a soul out there \nno one to hear my prayer \n\nGimme! Gimme! Gimme! \nA man after midnight \nwont somebody help me \nchase the shadows away \nGimme! Gimme! Gimme! \nA man after midnight \ntake me through the darkness \nto the break of the day \n\n 1979 Polar Music International AB\n\n#ABBA #GimmeGimmeGimme #AManAfterMidnight",
